import App from "./App";
import Start from "./Start";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function Home() {
  return (
    <Router>
      <div className="content">
        <Switch>
          <Route exact path="/Start" component={Start}>
            <Start />
          </Route>

          {/* <Route exact path="/App">
          <App />
        </Route> */}
        </Switch>
      </div>
    </Router>
  );
}

export default Home;
